import './Navbar.css';
import React,{useState,useEffect} from 'react';

function Navbar() {
    const [banana,setbanana] = useState("Hay");
    
    const setFunction=()=>{
        setbanana("Ciao");
    }

    console.log(banana);

    return (
        <div>{()=>setFunction()}</div>
    )
}

export default Navbar
